import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  headerLeftContainer: {
    flexDirection: 'row',
    alignItems: 'flex-start',
  },
  headerRightContainer: {
    paddingRight: 10,
  },
  locationIcon: {
    marginRight: 10,
  },
  headerTitle: {
    fontWeight: 'bold',
    fontSize: 16,
  },
});
